import './App.css';


function VCard() {
  return (
    <div class="container">
    <div className="vCard">
      <h3>Nadia Akhtar</h3>
      <p>Junior Dev</p>
      <p>fizakhan81@outlook.com</p>
      <p>0000-00-00-00</p>
        <div class="icons">
        <a href="https://github.com/FizaKhan2511" target="_blank">
        <svg class="github-icon" viewBox="0 0 24 24"></svg>
        </a>  
        </div>

    </div>
    </div>
  );
}




